-- SQL Script for creating database and inserting data from the Excel file
-- Database Name: CzechCommunitiesDB
-- Table Name: Communities
-- Columns: Name, RegistrationNumber, CaseNumber, FoundingDate, Address

-- Create the database
CREATE DATABASE CzechCommunitiesDB;

-- Use the database
USE CzechCommunitiesDB;

-- Create the table
CREATE TABLE Communities (
                          Name VARCHAR(255),
                          RegistrationNumber VARCHAR(50),
                          CaseNumber VARCHAR(255),
                          FoundingDate VARCHAR(50),
                          Address VARCHAR(255)
);

